import React from 'react'
import PropTypes from 'prop-types'

const TercerComponente = props => {
    const anioActual = Date
    return (
    <div>
        <br></br>
        <h3>Fecha</h3>
        
        <br></br>
    </div>
  )
}

TercerComponente.propTypes = {
    fecha: PropTypes.number.isRequired
}

export default TercerComponente
